package adventofcode;

import java.io.ByteArrayInputStream;
import java.util.*;

public class Puzzle5
{
	static void fakeInput()
	{
		String input = "";
		System.setIn(new ByteArrayInputStream(input.getBytes()));
	}
	
	private static final int ASCII_OFFSET = 32;
	private static final int A_ASCII_CODE = 65;
	private static final int Z_ASCII_CODE = 90;
	
	private static int getResultPolymerUnits(String polymer)
	{
		var stack = new Stack<Character>();
		
		for (var i = 0; i < polymer.length(); i++)
		{
			if (!stack.empty())
			{
				var curr = polymer.charAt(i);
				var upperToLower = (stack.peek() + ASCII_OFFSET);
				var lowerToUpper = (stack.peek() - ASCII_OFFSET);
				
				if (curr == upperToLower || curr == lowerToUpper)
					stack.pop();
				else
					stack.push(curr);
			} else
				stack.push(polymer.charAt(i));
		}
		
		return stack.size();
	}
	
	private static int getLengthWhenRemoving(String polymer, char ch)
	{
		var alteredInput = removeMaxProducedUnits(polymer, ch);
		
		return getResultPolymerUnits(alteredInput);
	}
	
	private static String removeMaxProducedUnits(String polymer, char ch)
	{
		return polymer
				.replace(Character.toString(Character.toUpperCase(ch)), "")
				.replace(Character.toString(Character.toLowerCase(ch)), "");
	}
	
	private static Map<Character, Integer> getUnitsShortestLengths(String polymer)
	{
		var map = new HashMap<Character, Integer>();
		
		for (char i = A_ASCII_CODE; i <= Z_ASCII_CODE; i++)
			map.put(i, getLengthWhenRemoving(polymer, i));
		
		return map;
	}
	
	@SuppressWarnings("OptionalGetWithoutIsPresent")
	private static int getShortestLength(Map<Character, Integer> lengths)
	{
		return lengths.values()
				.stream()
				.min(Comparator.naturalOrder())
				.get();
	}
	
	public static void main(String[] args)
	{
		var polymer = "";
		
		fakeInput();
		try (var input = new Scanner(System.in))
		{
			polymer = input.nextLine().trim();
		}
		
		System.out.println(getResultPolymerUnits(polymer));
		System.out.println(getShortestLength(getUnitsShortestLengths(polymer)));
	}
}
